export default async function improvePrompt({
  apiKey,
  alchemy,
  height,
  width,
  modelId,
  num_images,
  presetStyle,
  prompt,
}: NodeInputs) : NodeOutput  {
  const response = await fetch(
    "https://cloud.leonardo.ai/api/rest/v1/generations",
    {
      method: "POST",
      headers: {
        Authorization: `Bearer ${apiKey}`,
        accept: "application/json",
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        alchemy: alchemy,
        height: parseInt(height),
        modelId: modelId,
        num_images: parseInt(num_images),
        presetStyle: presetStyle,
        prompt: prompt,
        width: parseInt(width),
      }),
    }
  );

  const responseData = await response.json();
  return responseData.sdGenerationJob;
}

export default async function generatePrompt({
    apiKey
}: NodeInputs) : NodeOutput  {
    const response = await fetch('https://cloud.leonardo.ai/api/rest/v1/prompt/random', {
        method: 'POST',
        headers: {
            'Authorization': `Bearer ${apiKey}`,
            accept: 'application/json',
        }
    });

    const responseData = await response.json();
    return responseData.promptGeneration.prompt;
}

export default async function improvePrompt({
    apiKey,
    prompt
}: NodeInputs) : NodeOutput  {
    const response = await fetch('https://cloud.leonardo.ai/api/rest/v1/prompt/improve', {
        method: 'POST',
        headers: {
            'Authorization': `Bearer ${apiKey}`,
            accept: 'application/json',
            'Content-Type': 'application/json'
        },
        body: JSON.stringify({
            prompt
        })
    });

    const responseData = await response.json();
    return responseData.promptGeneration.prompt;
}

function createFile(fileData, fileName) {
    if (typeof fileData === 'string') {
        // If fileData is a file path
        return new Promise((resolve, reject) => {
            fetch(fileData)
                .then(response => response.blob())
                .then(blob => {
                    const file = new File([blob], fileName);
                    resolve(file);
                })
                .catch(error => reject(error));
        });
    } else if (fileData instanceof ArrayBuffer || ArrayBuffer.isView(fileData)) {
        // If fileData is a file buffer
        const blob = new Blob([fileData]);
        return Promise.resolve(new File([blob], fileName));
    } else {
        return Promise.reject(new Error('Invalid file data type'));
    }
}

export default async function uploadInitImage({
    fileData,
    fields,
    url,
    fileName
}: NodeInputs, { logging }: NodeScriptOptions) : NodeOutput  {
    const parsedFields = JSON.parse(fields);

    const file = await createFile(fileData, fileName);

    const formData = new FormData();
    Object.entries({ ...parsedFields, file }).forEach(([key, value]) => {
        formData.append(key, value as string);
    });

    const request = new XMLHttpRequest();
    request.open('POST', url);

    const result = await request.send(formData);
    return result;
}

export default async function uploadInitImage({
    apiKey,
    extension
}: NodeInputs) : NodeOutput  {
    const response = await fetch('https://cloud.leonardo.ai/api/rest/v1/init-image', {
        method: 'POST',
        headers: {
            'Authorization': `Bearer ${apiKey}`,
            accept: 'application/json',
            'content-type': 'application/json',
        },
        body: JSON.stringify({extension: extension})
    });

    const responseData = await response.json();
    return responseData.uploadInitImage;
}
